INSERT INTO `wp_wc_admin_notes` (`note_id`, `name`, `type`, `locale`, `title`, `content`, `icon`, `content_data`, `status`, `source`, `date_created`, `date_reminder`, `is_snoozable`) VALUES
(1, 'wc-admin-welcome-note', 'info', 'en_US', 'New feature(s)', 'Welcome to the new WooCommerce experience! In this new release you\'ll be able to have a glimpse of how your store is doing in the Dashboard, manage important aspects of your business (such as managing orders, stock, reviews) from anywhere in the interface, dive into your store data with a completely new Analytics section and more!', 'info', '{}', 'unactioned', 'woocommerce-admin', '2019-10-28 21:59:59', NULL, 0),
(2, 'wc-admin-wc-helper-connection', 'info', 'en_US', 'Connect to WooCommerce.com', 'Connect to get important product notifications and updates.', 'info', '{}', 'unactioned', 'woocommerce-admin', '2019-10-28 21:59:59', NULL, 0),
(3, 'wc-admin-mobile-app', 'info', 'en_US', 'Instala la aplicacin mvil WooCommerce', 'Instala la aplicacin mvil de WooCommerce para gestionar pedidos, recibir avisos de ventas y ver mtricas clave all donde ests.', 'phone', '{}', 'unactioned', 'woocommerce-admin', '2019-10-30 22:02:55', NULL, 0),
(4, 'wc-admin-store-notice-giving-feedback', 'info', 'en_US', 'Valora tu experiencia', 'Si te gusta WooCommerce Admin, por favor, djanos una valoracin de 5 estrellas. Muchas gracias por adelantado!', 'info', '{}', 'unactioned', 'woocommerce-admin', '2019-11-04 00:39:40', NULL, 0),
(5, 'wc-admin-facebook-extension', 'info', 'en_US', 'Vende en Facebook', 'Haz crecer tu negocio dirigindote a las personas adecuadas e impulsando las ventas con Facebook. Puedes instalar ahora esta extensin gratuita.', 'thumbs-up', '{}', 'unactioned', 'woocommerce-admin', '2019-11-04 00:39:40', NULL, 0);
